const handleTouchStart = (index) => {
    console.log(`handleTouchStart ${index}`)
    setTimer(setTimeout(() => {
        setState({
            editIndex: index,
            showButtons: true
        })
    }, 1000));
};

const handleTouchEnd = () => {
    clearTimeout(timer);
};

export default {handleTouchStart, handleTouchEnd};
